/**
 * File Description: This component is the right pane of the website to display the results of customer
 * Author(s): Sashank Pindiproli
 * Date of Creation: 11/07/2020
 */

import React, { Fragment } from 'react';
import styled from 'styled-components';
import { Card } from 'react-bootstrap';
const RightPane = ({ customerDetails }) => {
  let { name, address } = customerDetails;
  return (
    <Fragment>
      {name !== undefined ? (
        <StyledContainer id="right-pane__container">
          <StyledCard>
            <Card.Body>
              <Card.Title>{name}</Card.Title>
              {address.map((item) => console.log(item))}
              <Card.Text></Card.Text>
            </Card.Body>
          </StyledCard>
        </StyledContainer>
      ) : null}
    </Fragment>
  );
};

const StyledContainer = styled.div`
  border: 2px solid black;
  width: calc(59.1%);
  margin-left: 1vh;
  margin-top: 0.5vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const StyledCard = styled(Card)`
  background: red;
  height: 40em;
`;
export default RightPane;
